import React, { Component } from "react";
import { Link } from "react-router-dom";
import {
  Button,
  Dimmer,
  Header,
  Icon,
  Image,
  Segment,
  Grid,
  Form,
  Message,
  Container,
  Divider,
  List
} from "semantic-ui-react";
import logo from "../images/Login_Signup/logo.jpg";

class Home extends Component {
  componentDidMount() {
    fetch(
      "https://newsapi.org/v2/everything?q=%22overwatch%20league%22&language=en&from=2019-04-01&to=2019-04-10&pageSize=10&sortBy=poularity&apiKey=ea985880356a4b5995f5e0c37af8a424/cors-anywhere.html",
      {
        headers: {
          "Content-Type": "application/json",
          Accept: "application/json"
        }
      }
    )
      .then(r => r.json())
      .then(r => console.log(r));
  }

  render() {
    return (
      <Container className="main">
        <Container as="h1" textAlign="center">
          Welcome to Overtrack
        </Container>
        <Divider />
        <Grid fluid columns={2} verticalAlign="top">
          <Grid.Row verticalAlign="top" />
          <Grid.Column>
            <Link to="/record">
              <Button fluid className="homebutton">
                Record A Game
              </Button>
            </Link>
          </Grid.Column>

          <Grid.Column>
            <Link to="/history">
              <Button fluid className="homebutton">
                View Match History
              </Button>
            </Link>
          </Grid.Column>
        </Grid>
        <Grid>
          <Grid.Column>
            <Container as="h2" textAlign="center">
              News
            </Container>
            <Divider />
            <List>
              <List.Item />
            </List>
          </Grid.Column>
        </Grid>
      </Container>
    );
  }
}

export default Home;
